import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';  // Import React Router components
import Login from './components/Login';  // Import Login component
import Home from './components/Home/Home';  // Import Home component
import GovernmentServices from './components/GovernmentServices/GovernmentServices';  // Import GovernmentServices component

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Route for Login page */}
        <Route path="/login" element={<Login />} />

        {/* Route for Home page */}
        <Route path="/home" element={<Home />} />

        {/* Route for Government Services page */}
        <Route path="/government-services" element={<GovernmentServices />} />

        {/* Default Route */}
        <Route path="/" element={<Login />} />  {/* Default route will be Login */}
      </Routes>
    </Router>
  );
};

export default App;
